    <script type="text/javascript">
        function showitem(cumpliento, order) {
            console.log(cumpliento)
            const charts = { 'Cumple': 'ch_cump_detalle', 'Pr%u00F3ximo a no Cumplir': 'ch_cump_detall1', 'No Cumple': 'ch_cump_detall2' };
            document.querySelectorAll('.detalleCharts > div').forEach(function (element) {

                element.classList.remove('fadeInLeft')
            })
            document.querySelector('div [data-id="' + charts[cumpliento] + '"').style.display = 'block';

            utilsDocument.getReport(charts[cumpliento]).customResize();
            document.querySelector('div [data-id="' + charts[cumpliento] + '"').classList.toggle('fadeInLeft')

        }
